import React, { useState, useEffect } from "react";

const Input= () => {
    return (
    <select id="voice-select" style={{height: "50px", width:"100px", zIndex:"31111111", position:"absolute", top:"10vh"}} class="form-control form-control-lg">
        <option value="India">India</option>
        <option value="UK">UK</option>
        <option value="USA">USA</option>
    </select>
    );
}

export default Input;
